import logo from "./logo.svg";
import "./App.css";
import { ToDoBoard } from "./features/todoList/ToDoBoard";
import * as React from "react";
import Box from "@mui/material/Box";

function App() {
  return (
    <Box sx={{ border: 1, width: 1 / 2, borderColor: "primary.main" }} id="App">
      <ToDoBoard />
    </Box>
  );
}
export default App;
